/*Table structure for table `feedback_c` */

DROP TABLE IF EXISTS `feedback_c`;

CREATE TABLE `feedback_c` (
  `FEEDBACK_ID` varchar(40) NOT NULL,
  `INPUT_BY` varchar(20) default NULL,
  `INPUT_TIME` datetime default NULL,
  `TITLE` varchar(200) default NULL,
  `CONTENT` text,
  `CLASS_TYPE` char(1) default NULL COMMENT '1管理2安全3建议4其他',
  `TEL` varchar(20) default NULL,
  `ANSWER_BY` varchar(20) default NULL,
  `ANSWER_TIME` datetime default NULL,
  `SOLVE_METHOD` text,
  `RESOLUTION` char(1) default NULL COMMENT '1已修改2无需修改3重复问题4描述不完整5无法再现6其他',
  `DIFFICULTY` char(1) default NULL COMMENT '1极难2比较难3有难度4一般',
  `IS_SHARE` char(1) default NULL COMMENT '0不公开1公开',
  `STATE` char(1) default NULL COMMENT '0未处理1已处理',
  `CREATE_BY` varchar(40) default NULL,
  `CREATE_DEPT` varchar(40) default NULL,
  `CREATE_TIME` datetime default NULL,
  PRIMARY KEY  (`FEEDBACK_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

