DROP TABLE IF EXISTS `manage_area_p`;

CREATE TABLE `manage_area_p` (
  `MANAGE_AREA_ID` varchar(40) NOT NULL,
  `USER_ID` varchar(40) default NULL,
  `MADEPT_ID` varchar(40) default NULL,
