/*Table structure for table `news_b` */

DROP TABLE IF EXISTS `news_b`;

CREATE TABLE `news_b` (
  `NEWS_ID` varchar(40) NOT NULL,
  `INPUT_TIME` datetime default NULL,
  `DEPT_NAME` varchar(100) default NULL,
  `TITLE` varchar(200) default NULL,
  `SUB_TITLE` varchar(100) default NULL,
  `AUTHOR` varchar(30) default NULL,
  `KEY_STR` varchar(50) default NULL,
  `CSOURCE` varchar(50) default NULL,
  `IS_TOP` char(1) default NULL,
  `ORDER_NO` decimal(18,0) default NULL,
  `CONTENT` text,
  `IMAGE_URL` varchar(200) default NULL,
  `FLASH_IMAGE` varchar(200) default NULL,
  `IS_IMAGE` char(1) default NULL,
  `STATE` char(1) default NULL,
  `CLICK_NUM` int(11) default NULL,
  `USER_LEVEL` int(11) default NULL,
  `DUTY_LEVEL` varchar(40) default NULL,
  `SPECIAL_TYPE` varchar(40) default NULL,
  `CREATE_BY` varchar(40) default NULL,
  `CREATE_DEPT` varchar(40) default NULL,
  `CREATE_TIME` datetime default NULL,
  PRIMARY KEY  (`NEWS_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `news_b` */

/*Table structure for table `on_line_message_c` */

DROP TABLE IF EXISTS `on_line_message_c`;

CREATE TABLE `on_line_message_c` (
  `ON_LINE_MESSAGE_ID` varchar(40) NOT NULL,
  `PLAN_ID` varchar(40) default NULL,
  `TASK_ID` varchar(40) default NULL,
  `DEPT_NAME` varchar(100) default NULL,
  `AUTHOR` varchar(40) default NULL,
  `CONTENT` varchar(3000) default NULL,
  `PIC_COLOR` varchar(7) default NULL,
  `PIC_NO` tinyint(4) default NULL,
  `POS_X` int(11) default NULL,
  `POS_Y` int(11) default NULL,
  `CTYPE` int(11) default NULL,
  `BACK_CONTENT` varchar(3000) default NULL,
  `BACK_TIME` datetime default NULL,
  `REVOKE_CONTENT` varchar(3000) default NULL,
  `REVOKE_TIME` datetime default NULL,
  `REVOKE_SURE_TIME` datetime default NULL,
  `SMS_NOTICE` tinyint(4) default NULL,
  `PRIORITY` int(11) default NULL,
  `OWNER_BY` varchar(40) default NULL,
  `OWNER_DEPT` varchar(40) default NULL,
  `OWNER_NAME` varchar(40) default NULL,
  `STATE` int(11) default NULL,
  `READ_TIME` datetime default NULL,
  `ACCEPT_TIME` datetime default NULL,
  `DEAL_WITH_TIME` datetime default NULL,
  `RESULT_TIME` datetime default NULL,
  `FINISHED_TIME` datetime default NULL,
  `FINISHED` tinyint(4) default NULL,
  `CREATE_BY` varchar(40) default NULL,
  `CREATE_DEPT` varchar(40) default NULL,
  `CREATE_TIME` datetime default NULL,
  PRIMARY KEY  (`ON_LINE_MESSAGE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

