/*Data for the table `sys_survey_b` */

insert  into `sys_survey_b`(`SYS_SURVEY_ID`,`TITLE`,`SQLSTR`,`ORDER_NO`,`STATE`,`ORASTR`) values ('1','自2011年6月17日班组管理系统上线以来, 系统已稳定运行[?]天','select convert(varchar(10),datediff(day, cast(\'2011.06.17\' as datetime) , getdate())) as no_of_days\r\n',1,'1',NULL),('10','工作动态[?]篇','select convert(varchar(10),count(*)) from NEWS_B',10,'1',NULL),('11','工作动态总访问次数[?]','select convert(varchar(10),sum(click_num)) from NEWS_B',11,'1',NULL),('12','工作动态单篇访问次数最高达[?]','select convert(varchar(10),max(click_num)) from NEWS_B ',12,'1',NULL),('13','工作动态平均访问次数[?]','select convert(varchar(10),avg(click_num)) from NEWS_B',13,'1',NULL),('14','通知公告[?]篇','select convert(varchar(10),count(*)) from NOTICE_C',14,'1',NULL),('15','通知公告总访问次数[?]','select convert(varchar(10),sum(click_num)) from NOTICE_C',15,'1',NULL),('16','通知公告单篇访问次数最高达[?]','select convert(varchar(10),max(click_num)) from NOTICE_C',16,'1',NULL),('17','通知公告平均访问次数[?]','select convert(varchar(10),avg(click_num)) from NOTICE_C ',17,'1',NULL),('28','发送留言[?]条','select convert(varchar(10),count(*)) from ON_LINE_MESSAGE_C',28,'1',NULL),('29','系统操作日志记录[?]条','select convert(varchar(10),count(*)) from OPERATE_LOG_P',29,'1',NULL),('3','系统用户达[?]人','select convert(varchar(10),count(*)) from user_p',3,'1',NULL),('30','修改密码人数[?]','select convert(varchar(10),changepass)+\'/\'+convert(varchar(10),totalpass) as changepass\r\nfrom\r\n(\r\n	select sum(changepass) as changepass,sum(totalpass) as totalpass\r\n	from\r\n	(\r\n	(select count(*) as changepass,0 as totalpass from USER_P where realp is not null and realp<>\'000000\')\r\n	union\r\n	(select 0 as changepass,count(*) as totalpass from USER_P)\r\n	) t\r\n) t\r\n',30,'1',NULL),('8','系统总访问次数[?]','select convert(varchar(10),count(*)) from LOGIN_LOG_P',8,'1',NULL),('9','日最大访问次数[?]','select convert(varchar(10),max(login_num)) from ( select count(*) as login_num from LOGIN_LOG_P group by convert(varchar(10),login_time,126)) t',9,'1',NULL);

